import React from 'react';
import Task from "../../Task/task";
import TaskInput from "../../task-input";

const TaskItem = ({className}) => {
    if(className == 'completed') {
        return <li><Task label={className}/></li>
    }
    else if(className == 'editing') {
        return (<li>
                <Task className='view' label={className}/>
                <TaskInput type="text" className="edit" value="Editing task"/>
             </li>);
    }
    else {
        return  <li><Task label={className}/></li>
    }



};

export default TaskItem;
